    function __getBasicResultsData(results) {
        var maxVotes = 0;
        var nextVotes = 0;
        var voteMargin = 0;
        var maxResult = null;
        var totalVotes = 0;
        var winningParty = "";
        for (var i = 0, len = results.length; i < len; i++) {
            var res = results[i];
            var votes = res.vote_count;
            if (votes > 0) {
                if (votes == maxVotes) {
                    nextVotes = maxVotes;
                    maxResult = null
                } else if (votes > maxVotes) {
                    if (totalVotes == 0) {
                        totalVotes = votes / parseFloat(res.pct) * 100;
                        totalVotes = Math.round(totalVotes)
                    }
                    maxResult = res;
                    nextVotes = maxVotes;
                    maxVotes = votes
                } else if (votes > nextVotes) {
                    nextVotes = votes
                }
            }
            if (res.winner) {
                winningParty = res.party_id
            }
        }
        var obj = {
            max_votes: maxVotes,
            vote_margin: maxVotes - nextVotes,
            total_votes: totalVotes,
            winning_party: winningParty,
            leading_party: maxResult ? maxResult.party_id : ""
        };
        return obj
    }

